__NUXT_JSONP__("/svet/stat/indonesie/ceny", (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:[{tabsLoad:{tabWhatToSee:d,tabPrice:d,tabPeople:d,tabTrip:d,tabContact:d,tabHotel:d,tabNeighboring:d,tabVideos:g,tabArticles:g,tabWallSockets:h,tabChains:5},place:[{tld:".id",name:"Indonésie",area:191093,population:276542363,slug:i,id_continent:e,information_chatgpt:"\u003Cp\u003EIndonésie je ostrovní země v jihovýchodní Asii, která se skládá z více než 17 000 ostrovů. Hlavním městem je Jakarta, která je centrem ekonomiky, kultury a politiky země. Indonésie je domovem pro různé etnické skupiny, kultury a náboženství, což z ní činí velmi rozmanitou zemi.\u003C\u002Fp\u003E\n\u003Cp\u003EIndonésie je známá svými krásnými plážemi, ostrovy a přírodními krásami, jako jsou sopky, řeky, vodopády a národní parky. Turisté mohou navštívit ostrovy jako Bali, Lombok, Komodo, Sumatra nebo Java a užívat si krásné pláže, surfování, potápění, trekking, nebo relaxaci v luxusních resortech.\u003C\u002Fp\u003E\n\u003Cp\u003EIndonésie má také bohatou historii a kulturní dědictví, jako jsou chrámy Borobudur a Prambanan na Jávě, či chrám Tanah Lot na Bali. Indonésie je také známá svým uměním, řemeslnými výrobky a trhy, kde můžete najít všechno od batikových látek až po tradiční indonéské masky.\u003C\u002Fp\u003E\n\u003Cp\u003EIndonéská kuchyně je také bohatá a rozmanitá. Návštěvníci si mohou vychutnat tradiční jídla jako je nasi goreng (směs rýže s kořením, zeleninou a masem), satay (grilované maso na špejli), nebo gado-gado (směs zeleniny s arašídovou omáčkou).\u003C\u002Fp\u003E\n\u003Cp\u003EJe však důležité mít na paměti, že Indonésie je také zemí s vysokým rizikem pro přírodní katastrofy, jako jsou zemětřesení, sopečné erupce a tsunamii. Proto by turisté měli být obezřetní a informovat se o aktuálních varováních a bezpečnostních opatřeních.\u003C\u002Fp\u003E",currency_code:"IDR",currency_name:"rupie",money_prices:[{name:"Taxi (cena za km)",value:5500,date_update:b},{name:"Hlavní jídlo",value:25000,date_update:b},{name:"Chleba",value:j,date_update:b},{name:"Mléko",value:18000,date_update:b},{name:"Voda (500ml)",value:5000,date_update:b},{name:"Espresso",value:15000,date_update:b},{name:"Zmrzlina (jeden kopeček)",value:8000,date_update:b},{name:"Pivo",value:k,date_update:b},{name:"Krabička cigaret",value:24000,date_update:b},{name:"Bic Mac",value:k,date_update:b},{name:"Coca Cola (500ml)",value:j,date_update:b}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:"112",date_update:a},{name:"Policie",value:"110",date_update:a},{name:"Hasiči",value:"113",date_update:a},{name:"Zdravotnická záchranná služba",value:"119",date_update:a},{name:"Turistická policie",value:"0811-211-3080",date_update:a}],phone_prefix:"+62",coordinates:[{latitude:"-0.7893",longitude:"113.9213"}],people_religion:[{name:"Islám",value:"87,2%"},{name:"Křesťanství",value:"9,9%"},{name:"Hinduismus",value:"1,7%"},{name:"Buddhismus",value:"0,8%"},{name:"Jiná náboženství",value:"0,4%"}],people_nationality:[{name:"Javané",value:"40,1%"},{name:"Sundánci",value:"15,5%"},{name:"Madarští",value:"3,7%"},{name:"Betawiové",value:"3,6%"},{name:"Minangkabauové",value:"2,8%"},{name:"Batak",value:l},{name:"Bugi",value:l},{name:"Východoindonéské národy",value:"2,5%"},{name:"Malajci",value:"2,4%"},{name:"Jiné",value:"24%"}],visitors_entry:[{name:"Občanský průkaz",value:"Pro vstup do Indonésie není možné použít pouze občanský průkaz, je nutné mít platný cestovní pas.",date_update:a},{name:"Cestovní pas",value:"Pro vstup do Indonésie je nutné mít platný cestovní pas. Pas musí být platný minimálně 6 měsíců od data vstupu do země.",date_update:a},{name:"Vízum",value:"Pro vstup do Indonésie je potřeba mít vízum. Občané Evropské unie mají možnost získat turistické vízum při příjezdu na letišti v Indonésii. Vízum je platné 30 dní a lze ho prodloužit o dalších 30 dní. Při pobytu delším než 30 dnů nebo v jiných případech (např. pracovní pobyt) je nutné vízum získat předem na ambasádě nebo konzulátu Indonésie v místě bydliště.",date_update:a},{name:"Očkování",value:"Pro vstup do Indonésie není povinné očkování. Nicméně se doporučuje očkování proti žluté zimnici a tyfu, zejména při návštěvě určitých oblastí země. Dále se doporučuje očkování proti hepatitidě A a B, tetanu a spále.",date_update:a},{name:"Cestovní pojištění",value:"Pro vstup do Indonésie není vyžadováno cestovní ani zdravotní pojištění, nicméně je vždy doporučeno si ho sjednat kvůli možnému nečekanému zdravotnímu problému nebo úrazu.",date_update:a},{name:"Bezpečnostní situace",value:"V Indonésii je vysoké riziko teroristických útoků, zejména na Bali a v Jávském moři. Měli byste být obezřetní a v souladu s pokyny místních úřadů. Kromě toho jsou zde občasné protesty a demonstrace, které mohou být násilné, zejména v období politických voleb.",date_update:a},{name:"Další informace",value:"Je dobré být obezřetní při plánování cesty do Indonésie. Je třeba mít na paměti, že tamní kultura a zvyky mohou být odlišné od těch evropských. V některých oblastech jsou například přijatelné jiné způsoby oblékání než v jiných zemích. Dále se doporučuje dodržovat hygienická pravidla, jako například pití balené vody a pečlivé mytí ovoce a zeleniny. Je také vhodné si ověřit platnost a aktuálnost informací o místech, která plánujete navštívit, a sledovat aktuální bezpečnostní situaci.",date_update:a}],type_place:m,id_image_cover:f,id_image_hero:f,id_city_main:978,affiliate:[{name:"booking",value:d}],mpz:"ID",alerts:c,zoom:[{google:e,booking:4}],ids_neighboring_countries:[{id:158},{id:176},{id:221}],organization:c,apps:c,links:c,information_author:c,seo_tags:c,language_phrases:c,wall_sockets:c,id:101,facts_place:c,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2023-12-27T17:07:31.480426+00:00"}],imagePlace:[{id:f,name:i,source:"\u002Fworld\u002Fstates\u002F",type:m,author:"pixabay.com",created_at:"2023-05-02T18:49:47.851894+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:e,slug:"asie",name:"Asie",area:44580000,population:4630000000,population_density:104.03,number_states:50,information_chatgpt:"\u003Cp\u003E\u003Cb\u003EAsie\u003C\u002Fb\u003E se rozkládá na ploše téměř 44,6 milionu kilometrů čtverečních a žije zde více než 4,5 miliardy lidí, což představuje téměř 60 % celkového počtu obyvatel planety. Kontinent zahrnuje celkem 48 zemí, mezi největší patří \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Frusko\"\u003ERusko\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fcina\"\u003EČína\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findie\"\u003EIndie\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fjaponsko\"\u003EJaponsko\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findonesie\"\u003EIndonésie\u003C\u002Fa\u003E\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAsie\u003C\u002Fb\u003E je domovem mnoha významných světových kultur, jako jsou hinduismus, buddhismus, islám a taoismus. V každé zemi se můžeš setkat s odlišnými tradicemi, zvyky a jazyky. Mezi nejnavštěvovanější turistické destinace patří například \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fjaponsko\"\u003EJaponsko\u003C\u002Fa\u003E\u003C\u002Fb\u003E s jeho futuristickými městy, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fthajsko\"\u003EThajsko\u003C\u002Fa\u003E\u003C\u002Fb\u003E s bohatou kulturou a krásnými plážemi, nebo \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findonesie\"\u003EIndonésie\u003C\u002Fa\u003E\u003C\u002Fb\u003E s neuvěřitelnou přírodou a množstvím ostrovů.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAsie\u003C\u002Fb\u003E také nabízí mnoho kulturních a historických památek, jako je \u003Cb\u003EVelká čínská zeď\u003C\u002Fb\u003E, \u003Cb\u003ETaj Mahal\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findie\"\u003EIndii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, buddhistické chrámy v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fthajsko\"\u003EThajsku\u003C\u002Fa\u003E\u003C\u002Fb\u003E a mnoho dalšího. Zajímavou zkušeností může být i návštěva tradičních trhů, kde se dají ochutnat místní speciality a nakoupit různé exotické produkty.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAsie\u003C\u002Fb\u003E má však také své výzvy a problémy, jako jsou například růst městských oblastí, nedostatek vody a znečištění ovzduší. Mnoho zemí se snaží najít řešení těchto problémů a přizpůsobit se moderním trendům, aby mohly udržet krok s ostatními zeměmi světa.\u003C\u002Fp\u003E\n\u003Cp\u003EPokud tě láká cestování po \u003Cb\u003EAsii\u003C\u002Fb\u003E, měl by sis předem zajistit víza a informovat se o místních zvycích a tradicích. Rozhodně se ti však naskytne možnost prozkoumat jedinečnou kulturu, přírodu a historii tohoto fascinujícího kontinentu.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cb\u003EAsie\u003C\u002Fb\u003E má také neuvěřitelně bohatou gastronomii, která se v jednotlivých zemích a regionech liší. Mezi nejznámější asijské pokrmy patří \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fsushi\"\u003Esushi\u003C\u002Fa\u003E\u003C\u002Fb\u003E, různé druhy nudlí, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fcurry\"\u003Ecurry\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003Edim sum\u003C\u002Fb\u003E, \u003Cb\u003Epho\u003C\u002Fb\u003E a další. Kromě toho se v \u003Cb\u003EAsii\u003C\u002Fb\u003E pěstuje mnoho exotických plodin, jako jsou \u003Cb\u003Eduriany\u003C\u002Fb\u003E, \u003Cb\u003Emangostany\u003C\u002Fb\u003E, \u003Cb\u003Erambutany\u003C\u002Fb\u003E a další ovoce, které můžeš ochutnat pouze zde.\n\u003C\u002Fp\u003E\u003Cp\u003E\n\u003Cb\u003EAsie\u003C\u002Fb\u003E je také známá svými svátky a tradicemi, jako je například \u003Cb\u003Ečínský Nový rok\u003C\u002Fb\u003E, \u003Cb\u003EDiwali\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findie\"\u003EIndii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nebo \u003Cb\u003ESongkran\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fthajsko\"\u003EThajsku\u003C\u002Fa\u003E\u003C\u002Fb\u003E,. Tyto svátky jsou většinou spojeny s různými rituály a zvyky, které se v průběhu staletí vyvinuly a jsou dodnes respektovány.\n\u003C\u002Fp\u003E\u003Cp\u003E\nKromě toho má \u003Cb\u003EAsie\u003C\u002Fb\u003E mnoho přírodních krás, jako jsou \u003Cb\u003EHimálaje\u003C\u002Fb\u003E, pouště \u003Cb\u003EGobi\u003C\u002Fb\u003E a \u003Cb\u003EThar\u003C\u002Fb\u003E, nebo tropické pralesy v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Findonesie\"\u003EIndonésii\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmalajsie\"\u003EMalajsii\u003C\u002Fa\u003E\u003C\u002Fb\u003E. V \u003Cb\u003EAsii\u003C\u002Fb\u003E se také nachází mnoho národních parků a chráněných oblastí, kde žijí ohrožené druhy zvířat, jako jsou \u003Cb\u003Etygři\u003C\u002Fb\u003E, \u003Cb\u003Epandy\u003C\u002Fb\u003E, \u003Cb\u003Esloni\u003C\u002Fb\u003E a další.\n\u003C\u002Fp\u003E\u003Cp\u003E\nZkrátka, \u003Cb\u003EAsie\u003C\u002Fb\u003E je kontinent plný kontrastů a neuvěřitelných zážitků, které stojí za to objevovat. Budeš-li mít příležitost navštívit některou z asijských zemí, neváhej a vydaj se na dobrodružnou cestu plnou nových objevů a nezapomenutelných zážitků.\u003C\u002Fp\u003E",coordinates:[{latitude:47.751076,longitude:92.475286}],type_place:"continent",id_image_cover:e,id_image_hero:e,zoom:[{google:h,booking:e}],information_author:c,seo_tags:c,created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2023-12-27T17:07:06.531847+00:00"}]}],fetch:{},mutations:[]}}("05-2023","05-2021",null,true,3,269,0,2,"indonesie",9000,35000,"2,7%","state")));